import PropTypes from 'prop-types';
import React, { Component } from 'react';
import { Helmet } from 'react-helmet';
import {
	Button,
	Container,
	Divider,
	Grid,
	Header,
	Icon,
	Image,
	List,
	Menu,
	Responsive,
	Segment,
	Sidebar,
	Visibility,
} from 'semantic-ui-react';
import '../static/hometest.css';

// ======================
// Reusable Components
// ======================

const HomepageHeading = ({ mobile }) => (
	<Container text className="cont">
		{/* Add your heading content here */}
	</Container>
);

HomepageHeading.propTypes = {
	mobile: PropTypes.bool,
};

// ======================
// Layout Containers
// ======================

class DesktopContainer extends Component {
	state = { fixed: false };

	hideFixedMenu = () => this.setState({ fixed: false });
	showFixedMenu = () => this.setState({ fixed: true });

	render() {
		const { children } = this.props;
		const { fixed } = this.state;

		return (
			<Responsive>
				<Helmet>
					<title>HomePage</title>
					<link rel="shortcut icon" type="image/x-icon" href="../../static/logo3.png" />
					<link rel="stylesheet" href="//cdn.jsdelivr.net/npm/semantic-ui@2.4.2/dist/semantic.min.css" />
				</Helmet>

				<Visibility
					once={false}
					onBottomPassed={this.showFixedMenu}
					onBottomPassedReverse={this.hideFixedMenu}
				>
					<Segment inverted textAlign="center" style={{ minHeight: 700, padding: '1em 0em' }} vertical>
						<Menu
							fixed={fixed ? 'top' : null}
							inverted={!fixed}
							pointing={!fixed}
							secondary={!fixed}
							size="large"
							className="menu"
						>
							<Container>
								<Header as="h1" style={styles.mainTitle}>
									Every single vote matters
								</Header>
							</Container>
						</Menu>
						<HomepageHeading />
					</Segment>
				</Visibility>

				{children}
			</Responsive>
		);
	}
}

DesktopContainer.propTypes = {
	children: PropTypes.node,
};

const ResponsiveContainer = ({ children }) => (
	<div>
		<DesktopContainer>{children}</DesktopContainer>
	</div>
);

ResponsiveContainer.propTypes = {
	children: PropTypes.node,
};

// ======================
// Main Page Layout
// ======================

const HomepageLayout = () => (
	<ResponsiveContainer>
		{/* Main Content Section */}
		<Segment style={{ padding: '8em 0em' }} vertical>
			<Grid columns="equal" stackable>
				<Grid.Row textAlign="center">
					<Grid.Column style={styles.gridColumn}>
						<FeatureHeader text="Private" />
						<FeatureDescription text="Doesn't give any information regarding personal data." />

						<FeatureHeader text="Secure" />
						<FeatureDescription text="Not even a single chance of shutting down of the system." />
					</Grid.Column>

					<Image
						src="../static/ether2.png"
						width="216"
						height="256"
						style={{ paddingTop: '50px' }}
					/>

					<Grid.Column style={styles.gridColumn}>
						<FeatureHeader text="Decentralized" />
						<FeatureDescription text="Decentralized technology gives you the power to store your assets in a network." />

						<FeatureHeader text="Immutable" />
						<FeatureDescription text="Keeps its ledgers in a never-ending state of forwarding momentum." />
					</Grid.Column>
				</Grid.Row>
			</Grid>
		</Segment>

		{/* Footer/Quote Section */}
		<Segment inverted vertical style={styles.footerSegment}>
			<Container>
				<Header as="h3" style={styles.quoteHeader}>
					A fascinating quote
				</Header>
				<p style={styles.quoteText}>
					"We have elected to put our money and faith in a mathematical framework that is free of politics and human error."
				</p>
				<Header as="h2" style={styles.quoteAuthor}>
					Tyler Winklevoss
				</Header>
			</Container>
		</Segment>
	</ResponsiveContainer>
);

// ======================
// Helper Components
// ======================

const FeatureHeader = ({ text }) => (
	<Header as="h3" style={styles.featureHeader}>
		{text}
	</Header>
);

const FeatureDescription = ({ text }) => (
	<p style={styles.featureDescription}>
		{text}
	</p>
);

// ======================
// Style Constants
// ======================

const styles = {
	mainTitle: {
		color: '#627eea',
		verticalAlign: 'middle',
		fontFamily: 'Freestyle Script',
		fontSize: '400%',
		paddingLeft: '32%',
	},
	gridColumn: {
		paddingBottom: '5em',
		paddingTop: '5em'
	},
	footerSegment: {
		padding: '5em 0em',
		backgroundColor: '#627eea'
	},
	quoteHeader: {
		fontSize: '2em',
		color: 'white',
		textAlign: 'center'
	},
	quoteText: {
		fontSize: '1.33em',
		textAlign: 'center',
		fontStyle: 'italic'
	},
	quoteAuthor: {
		fontSize: '1.33em',
		color: 'white',
		textAlign: 'center'
	},
	featureHeader: {
		fontSize: '2em'
	},
	featureDescription: {
		fontSize: '1.33em'
	}
};

export default HomepageLayout;
